$(document).ready(function(){applications_page.init()});var applications_page={create_app_form:null,edit_app_form:null,init:function(){this.create_form()},create_form:function(){this.create_app_form=new formular("#create_app",function(b){console.log(b);if(b.status==="hitted"&&b.action==="submit"){var a={};$.each($("#create_app form").serializeArray(),function(c,d){a[d.name]=d.value});index.sdk.api.post($("#create_app form").attr("action"),a,function(c){console.log("updated ::: ",c)})}});this.create_app_form.init();this.edit_app_form=new formular("#edit_app",function(b){if(b.status==="hitted"){switch(b.action){case"submit":var a=applications_page.edit_app_form.get_datas();console.log("form_datas :::: ",a);index.sdk.api.put($("#edit_app form").attr("action"),a,function(c){console.log(c)});break;case"delete":var a={};index.sdk.api.deleting($("#edit_app form").attr("action"),{_id:$("#edit_app form").attr("data-id")},function(c){console.log(c)});break}}});this.edit_app_form.init();console.log("this.edit_app_form ::: ",this.edit_app_form)}};